import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header className="flex items-center justify-between px-6 py-4 shadow-md bg-white">
      {/* Logo */}
      <div className="flex items-center space-x-2">
        <img src="/logoenactus.png" alt="Enactus Logo" className="h-8" />
        <div className="text-sm text-gray-500">UK & Ireland</div>
      </div>

      {/* Navigation */}
      <nav className="flex space-x-8 text-sm font-medium text-gray-700">
        <Link to="/who-we-are" className="hover:text-yellow-500">
          WHO WE ARE
        </Link>
        <Link to="/impact" className="hover:text-yellow-500">
          IMPACT
        </Link>
        <Link to="/become-a" className="hover:text-yellow-500">
          BECOME A...
        </Link>
        <Link to="/take-action" className="hover:text-yellow-500">
          TAKE ACTION
        </Link>
        <Link to="/opportunities" className="hover:text-yellow-500">
          OPPORTUNITIES
        </Link>
      </nav>
    </header>
  );
};

export default Header;
